import React, { Component } from "react";
import Header from "./components/Header";
import Members from "./components/Members";
import Teams from "./Teams";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      members: Teams,
    };
  }

  render() {
    return (
      <div className="App">
        <Header></Header>
        {this.state.navigator}
      </div>
    );
  }
}

export default App;
